import React, { Component } from 'react';

class Projects extends Component {
    constructor(props) {
        super(props);
        this.state = {
            data: {
                head : ["Burger Builder","Facial Recognition","Loan Prediction"],
                content: ["Burger Builder content","Facial Recognition content","Loan Prediction content"]
            }
        };
    }   
  
    render() {
        return (
        <div>
            <h2>It is {this.state.head[0]}.</h2>
        </div>
        );
    }
}
export default Projects;
